import React from 'react'

const CatbarBTN = (props) => {
    return(
        <div>
            <button style={catbar_btn_style}>{props.title}</button>
        </div>
    );
}


const catbar_btn_style = {
    width: "20%",
    height: "6vh",
    fontSize: "4vh",
    margin: "0",
    textAlign: "center",
    color: "white",
    backgroundColor: "#222831"
}
export default CatbarBTN
